('2269','18','7827','Villa Sanchez',Null,'Einfamilien Villa in Cala Vinas','32100','Cala Vinas liegt in der Gemeinde Calvia im Südwesten Mallorcas. Die Villa steht auf einem ca 1.000m² großen Grundstück mit einem kleinen Meerblick vom 1. OG. Die ca. 263m² Wohnfläche dieser sehr gepflegten Villa verteilt sich auf 2 Wohnetagen.  Im EG befinden sich die Eingangshalle mit Treppe zum 1. OG, Gäste WC mit Dusche, Zugang zur Garage, Wohn-Esszimmer, große Küche und Hauswirtschaftsraum. Im 1. OG befinden  sich 5 Schlafzimmer davon haben 3 ein Badezimmer en suite. Zur Ausstattung gehören eine Klimaanlage w/k, Kamin und PVC Doppelglasfenster. Im angelegten Garten hat es noch einen Pool und einen Barbecue. \r\n\r\n','32101','1172000','106','2014-10-06 13:38:19','110','2014-10-06 13:40:55',Null,'2275','76','1072',1,'1','0',Null,Null,Null,'32102',Null,'0','0','0',Null,'2015-04-14 11:24:56',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32103',Null,'32104',Null,'32105',Null,'32106','650 870 806 Aracel    609 204 519','32107','0',0,'4');
